import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Featured Products" section to be visible
    // Try to locate the first product card in the featured products grid
    // Use a selector that is robust to structure: find the first .product-card inside a .products-grid
    await page.waitForSelector('.products-grid .product-card', { timeout: 10000 });

    // Scroll the first product card into view (in case it's not visible)
    const firstProductCard = await page.$('.products-grid .product-card');
    if (firstProductCard) {
      await firstProductCard.scrollIntoViewIfNeeded();
    }

    // Take screenshot before clicking "Add to Cart"
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_first_product_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_first_product_visible.png'));

    // Find the "Add to Cart" button inside the first product card
    // Use a relative selector to avoid ambiguity
    const addToCartButton = await firstProductCard.$('button.add-to-cart');
    if (!addToCartButton) {
      throw new Error('Could not find "Add to Cart" button in the first product card');
    }

    // Click the "Add to Cart" button
    await addToCartButton.click();

    // Wait for the notification to appear (it uses .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_cart_notification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_cart_notification.png'));

    // Extract the cart count from the cart indicator (should be updated)
    // The cart count is shown in an element with id="cartCount"
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Optionally, open the cart to verify the product is present
    // The cart is shown when clicking the .cart element
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Wait for cart items to render
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modal.png'));

    // Extract product title from the first cart item
    const cartProductTitle = await page.$eval('.cart-item .cart-item-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first featured product to cart and verified it in the cart modal.",
      extractedData: {
        cartCount: cartCountText,
        cartFirstProductTitle: cartProductTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
